IF OBJECT_ID('dbo.proc_transform_155', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_155;
GO
CREATE PROCEDURE dbo.proc_transform_155
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_155
    SET payload = LEFT(payload, 1000) + N'|V4-155|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_155;
END
GO
IF OBJECT_ID('dbo.audit_v4_155', 'U') IS NULL
